    "fbLink": "/accept",
    "twitterLink": "/reject",
    "name": "일정 이름",
    "position": "일정 기간"
  }
]

  return (
    <div className='team-area'>
        <div className="">
          {suggestionData.map((single, key) => {
              return (
                <SuggestionOneSingle
                  data={single}
                  key={key}
                />
              );
            })}
        </div>
      </div>

  );
};

export default SuggestionOne;
